/**
 * @notice Creo Token contract, deflationary by transfer.
 */
contract Creo is  Context, Ownable, IBEP20 {
    using SafeMath for uint256;
    using Address for address;
    using Counters for Counters.Counter;

    struct Checkpoint {
        uint32 fromBlock;
        uint256 votes;
    }
    mapping(address => Counters.Counter) private _nonces;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => address) private _delegates;
    mapping(address => Checkpoint[]) private _checkpoints;
    Checkpoint[] private _totalSupplyCheckpoints;

    uint256 private _totalSupply;
    string private _name;
    string private _symbol;
    uint8 private _decimals;
    uint256 private _cap;
    uint256 private _mintingAllowedAfter;
    uint256 private _burnFee = 0;
    uint256 private _mintAmountLeft;
    uint256 private _minSupply;

    /// @notice The EIP-712 typehash for the contract's domain
    bytes32 public constant DOMAIN_TYPEHASH = keccak256("EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)");

    /// @notice The EIP-712 typehash for the delegation struct used by the contract
    bytes32 public constant DELEGATION_TYPEHASH = keccak256("Delegation(address delegatee,uint256 nonce,uint256 expiry)");

    /// @notice The EIP-712 typehash for the permit struct used by the contract
    bytes32 public constant PERMIT_TYPEHASH = keccak256("Permit(address owner,address spender,uint256 value,uint256 nonce,uint256 deadline)");

    /**
     * @notice event emitted when an account changes their delegate.
     */
    event DelegateChanged(address indexed delegator, address indexed fromDelegate, address indexed toDelegate);

    /**
     * @notice event emitted when a token transfer or delegate change results in changes to an account's voting power.
     */
    event DelegateVotesChanged(address indexed delegate, uint256 previousBalance, uint256 newBalance);

    constructor(string memory name, string memory symbol,uint256 cap, uint256 _initialSupply, uint256 minSupply_,uint256 mintingAllowedAfter_) public{
        require(cap > 0, "CREO: cap cannot be 0");
        require(_initialSupply < cap, 'CREO: all tokens cannot be mint on deployment');
        _cap = cap;
        // mint initial supply
      _mint(_msgSender(), _initialSupply);
      _mintAmountLeft = _cap.sub(_initialSupply);
      _mintingAllowedAfter= mintingAllowedAfter_;
      _minSupply = minSupply_;
      _name = name;
      _symbol = symbol;
      _decimals = 18;
    }

    /**
     * @notice Returns the token name.
     */
    function name() public override view returns (string memory) {
        return _name;
    }

    /**
     * @notice Returns the token decimals.
     */
    function decimals() public override view returns (uint8) {
        return _decimals;
    }

    /**
     * @notice Returns the token symbol.
     */
    function symbol() public override view returns (string memory) {
        return _symbol;
    }

    /**
     * @notice returns current circulating supply See.
     */
    function totalSupply() public override view returns (uint256) {
        return _totalSupply;
    }

    /**
     * @notice returns current circulating supply See.
     */
    function minSupply() public  view returns (uint256) {
        return _minSupply;
    }

    /**
     * @notice returns the cap on the token's total supply.
     */
    function cap() public view virtual returns (uint256) {
        return _cap;
    }

    /**
     * @notice returns current states for signing / validating signatures.
     */
    function nonces(address owner) public view virtual returns (uint256) {
        return _nonces[owner].current();
    }

    /**
     * @notice returns the % burn on each transfer.
     */
    function burnFee() public view virtual returns (uint256) {
        return _burnFee;
    }

    /**
     * @notice returns the % burn on each transfer.
     */
    function setBurnFee(uint256 fee) public virtual onlyOwner returns (bool) {
        _burnFee = fee;
        return true;
    }

    /**
     * @notice returns the amount of token, yet to be minted from the cap.
     */
    function mintAmountLeft() public view virtual returns (uint256) {
        return _mintAmountLeft;
    }

    /**
     * @notice returns the timestamp at which minting may be allowed.
     */
    function mintingAllowedAfter() public view virtual returns (uint256) {
        return _mintingAllowedAfter;
    }

    /**
     * @notice returns current token balance of input account.
     */
    function balanceOf(address account) public override view returns (uint256) {
        return _balances[account];
    }
    /**
     * @notice returns amount spender is allowed to spend from owner.
     */
    function allowance(address owner, address spender) public override view returns (uint256) {
        return _allowances[owner][spender];
    }

    /**
     * @notice returns the `pos`-th checkpoint for `account`.
     */
    function checkpoints(address account, uint32 pos) public view virtual returns (Checkpoint memory) {
        return _checkpoints[account][pos];
    }

    /**
     * @notice Get number of checkpoints for `account`.
     */
    function numCheckpoints(address account) public view virtual returns (uint32) {
        return SafeCast.toUint32(_checkpoints[account].length);
    }

    /**
     * @notice Get the address `account` is currently delegating to.
     */
    function delegates(address account) public view virtual returns (address) {
        return _delegates[account];
    }

    /**
     * @notice Gets the current votes balance for `account`
     */
    function getVotes(address account) public view returns (uint256) {
        uint256 pos = _checkpoints[account].length;
        return pos == 0 ? 0 : _checkpoints[account][pos - 1].votes;
    }

    /**
     * @notice Retrieve the number of votes for `account` at the end of `blockNumber`.
     */
    function getPastVotes(address account, uint256 blockNumber) public view returns (uint256) {
        require(blockNumber < block.number, "CREO: block not yet mined");
        return _checkpointsLookup(_checkpoints[account], blockNumber);
    }

    /**
     * @notice Retrieve the `totalSupply` at the end of `blockNumber`. Note, this value is the sum of all balances.
     * It is but NOT the sum of all the delegated votes!
     */
    function getPastTotalSupply(uint256 blockNumber) public view returns (uint256) {
        require(blockNumber < block.number, "CREO: block not yet mined");
        return _checkpointsLookup(_totalSupplyCheckpoints, blockNumber);
    }


    /**
    * @notice Delegate votes from `msg.sender` to `delegatee`
    * @param delegatee The address to delegate votes to
    */
    function delegate(address delegatee) public virtual {
        return _delegate(_msgSender(), delegatee);
    }

    /**
     * @notice Delegates votes from signatory to `delegatee`
     * @param expiry The time at which to expire the signature
     * @param v The recovery byte of the signature
     * @param r Half of the ECDSA signature pair
     * @param s Half of the ECDSA signature pair
     */
    function delegateBySig(address delegatee, uint256 nonce, uint256 expiry, uint8 v, bytes32 r, bytes32 s) public {
        require(now <= expiry, "CREO: signature expired");
        bytes32 domainSeparator = keccak256(abi.encode(DOMAIN_TYPEHASH, keccak256(bytes(name())),keccak256(bytes('1')), getChainId(), address(this)));
        bytes32 structHash = keccak256(abi.encode(DELEGATION_TYPEHASH, delegatee, nonce, expiry));
        bytes32 hashed = keccak256(abi.encodePacked("\x19\x01", domainSeparator, structHash));
        address signer = ecrecover(hashed, v, r, s);
        require(signer != address(0), "CREO: invalid signature");
        require(nonce == _useNonce(signer), "CREO: invalid nonce");
        return _delegate(signer, delegatee);
    }

    /**
     * @notice Moves `amount` from Caller to `recipient`
     */
    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    /**
     * @notice sets allowance of 'spender' over caller to 'amount'
     */
    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    /**
     * @notice Triggers an approval from owner to spender, a signature approval method, does not charge owner for gas
     * @param deadline The time at which to expire the signature
     * @param v The recovery byte of the signature
     * @param r Half of the ECDSA signature pair
     * @param s Half of the ECDSA signature pair
     */
    function permit(address owner, address spender, uint256 value, uint256 deadline, uint8 v, bytes32 r, bytes32 s) external {
        require(now <= deadline, "CREO: signature expired");
        bytes32 domainSeparator = keccak256(abi.encode(DOMAIN_TYPEHASH, keccak256(bytes(name())),keccak256(bytes('1')), getChainId(), address(this)));
        bytes32 structHash = keccak256(abi.encode(PERMIT_TYPEHASH, owner, spender, value, _useNonce(owner), deadline));
        bytes32 hashed = keccak256(abi.encodePacked("\x19\x01", domainSeparator, structHash));
        address signer = ecrecover(hashed, v, r, s);
        require(signer != address(0), "CREO:permit: invalid signature");
        require(signer == owner, "CREO: unauthorized");
         _approve(owner, spender, value);
    }

    /**
     * @notice Moves `amount` from `sender` to `recipient` 
     * @notice caller must have an allowance allocated from sender's balance
     */
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            _msgSender(),
            _allowances[sender][_msgSender()].sub(amount, 'CREO: transfer amount exceeds allowance')
        );
        return true;
    }

    /**
     * @notice Atomically increases the allowance granted to `spender` by the caller.
     */
    function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    /**
     * @notice Atomically decreases the allowance granted to `spender` by the caller.
     */
    function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender].sub(subtractedValue, 'CREO: decreased allowance below zero')
        );
        return true;
    }

    /**
     * @notice Creates `amount` tokens and assigns them to the caller. Requires authorized access, 
     */
    function mint(uint256 amount) public onlyOwner returns (bool) {
        require(_mintAmountLeft != 0, 'CREO: All Tokens has been minted');
        require(_mintAmountLeft >= amount, 'CREO: Mint amount exceeds mint balance');
        require(block.timestamp > _mintingAllowedAfter,  "CREO: Minting not permited yet.");
        _mintAmountLeft = _mintAmountLeft.sub(amount);
        _mint(_msgSender(), amount);
        if (_mintAmountLeft == 0 ){
            _mintingAllowedAfter = 0;
          }
        return true;
    }


     /**
     * @dev Lookup a value in a list of (sorted) checkpoints.
     */
    function _checkpointsLookup(Checkpoint[] storage ckpts, uint256 blockNumber) private view returns (uint256) {
        uint256 high = ckpts.length;
        uint256 low = 0;
        while (low < high) {
            uint256 mid = average(low, high);
            if (ckpts[mid].fromBlock > blockNumber) {
                high = mid;
            } else {
                low = mid + 1;
            }
        }

        return high == 0 ? 0 : ckpts[high - 1].votes;
    }


    /**
     * @dev Change delegation for `delegator` to `delegatee`.
     */
    function _delegate(address delegator, address delegatee) internal virtual {
        address currentDelegate = delegates(delegator);
        uint256 delegatorBalance = balanceOf(delegator);
        _delegates[delegator] = delegatee;

        _moveVotingPower(currentDelegate, delegatee, delegatorBalance);
        emit DelegateChanged(delegator, currentDelegate, delegatee);

    }

    function _moveVotingPower(
        address src,
        address dst,
        uint256 amount
    ) private {
        if (src != dst && amount > 0) {
            if (src != address(0)) {
                (uint256 oldWeight, uint256 newWeight) = _writeCheckpoint(_checkpoints[src], _subtract, amount);
                emit DelegateVotesChanged(src, oldWeight, newWeight);
            }

            if (dst != address(0)) {
                (uint256 oldWeight, uint256 newWeight) = _writeCheckpoint(_checkpoints[dst], _add, amount);
                emit DelegateVotesChanged(dst, oldWeight, newWeight);
            }
        }
    }

    function _writeCheckpoint(
        Checkpoint[] storage ckpts,
        function(uint256, uint256) view returns (uint256) op,
        uint256 delta
    ) private returns (uint256 oldWeight, uint256 newWeight) {
        uint256 pos = ckpts.length;
        oldWeight = pos == 0 ? 0 : ckpts[pos - 1].votes;
        newWeight = op(oldWeight, delta);

        if (pos > 0 && ckpts[pos - 1].fromBlock == block.number) {
            ckpts[pos - 1].votes = newWeight;
        } else {
            ckpts.push(Checkpoint({fromBlock: SafeCast.toUint32(block.number), votes: newWeight}));
        }
    }



    /**
     * @dev Moves tokens `amount` from `sender` to `recipient`.
     */
    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal {
        require(sender != address(0), 'CREO: transfer from the zero address');
        require(recipient != address(0), 'CREO: transfer to the zero address');


        _balances[sender] = _balances[sender].sub(amount, 'CREO: transfer amount exceeds balance');
        if(_burnFee > 0){
        uint256 burnValue = amount.div(uint256(100 / _burnFee));
        if (_totalSupply.sub(burnValue) >= _minSupply) {
        _totalSupply = _totalSupply.sub(burnValue);
        emit Transfer(_msgSender(), address(0), burnValue);
        _writeCheckpoint(_totalSupplyCheckpoints, _subtract, burnValue);
        _moveVotingPower(delegates(sender), address(0), burnValue);
        amount =  amount.sub(burnValue);
            }    
        }
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
        _moveVotingPower(delegates(sender), delegates(recipient), amount);
    }

    /** @dev Creates `amount` tokens and assigns them to `account`, increasing the total supply
     */
    function _mint(address account, uint256 amount) internal {
        require(account != address(0), 'CREO: mint to the zero address');
        // When minting tokens confirm that mint is not above cap
        require(totalSupply().add(amount) <= cap(), "CREO: cap exceeded");


        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
        _writeCheckpoint(_totalSupplyCheckpoints, _add, amount);
        _moveVotingPower(address(0), delegates(account), amount);
    }


    /**
     * @dev Sets `amount` as the allowance of `spender` over the `owner`s tokens.
     */
    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal {
        require(owner != address(0), 'CREO: approve from the zero address');
        require(spender != address(0), 'CREO: approve to the zero address');

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    /**
     * @dev "Consume a nonce": return the current value and increments to set next nonce.
     */
    function _useNonce(address owner) internal virtual returns (uint256 current) {
        Counters.Counter storage nonce = _nonces[owner];
        current = nonce.current();
        nonce.increment();
    }

    function _add(uint256 a, uint256 b) private pure returns (uint256) {
        return a + b;
    }

    function _subtract(uint256 a, uint256 b) private pure returns (uint256) {
        return a - b;
    }
    function average(uint256 a, uint256 b) internal pure returns (uint256) {
        // (a + b) / 2 can overflow.
        return (a & b) + (a ^ b) / 2;
    }
    function getChainId() private pure returns (uint) {
        uint256 chainId;
        assembly { chainId := chainid() }
        return chainId;
    }

}

